import Button from './Buttons/Button';

const arr: string[] =[
  'emma',
  'celes',
  'jime'
];
const App = () => {
  return (
    <div>
      {arr.map((item, index) => <h3 id={index}>{item}</h3>)}
      <Button texto='MANDAR' 
      edad={10}></Button>
    </div>
  );
}

export default App;
